DROP TABLE IF EXISTS `characters`;
CREATE TABLE `characters` (
  `id` int NOT NULL AUTO_INCREMENT,
  `creator` int NOT NULL,
  `name` varchar(30) COLLATE utf8mb4_general_ci NOT NULL,
