DROP TABLE IF EXISTS `involved`;
CREATE TABLE `involved` (
  `campaign_id` int NOT NULL,
  `character_id` int NOT NULL,
  PRIMARY KEY (`campaign_id`,`character_id`),
  KEY `character_id` (`character_id`),
  CONSTRAINT `involved_ibfk_3` FOREIGN KEY (`campaign_id`) REFERENCES `campaigns` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT,
  CONSTRAINT `involved_ibfk_4` FOREIGN KEY (`character_id`) REFERENCES `characters` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

